import React from 'react';
import './frame.css';

export class Frame extends React.Component {
	constructor(props) {
		super(props);
	}
	state = {		
		currentFrameOption: 0,
		frameOptions: [
	    {
		  frameId: 0,
		  frameName: 'garbage-truck'
	    },
	    {
		  frameId: 1,
		  frameName: 'fire-truck'
	    },
	    {
		  frameId: 2,
		  frameName: 'school-bus'
	    },
	    {
		  frameId: 3,
		  frameName: 'tractor'
	    },
	    {
		  frameId: 4,
		  frameName: 'police-car'
	    }
   		]
	}

	componentDidMount() {
	}

	componentDidUpdate(prevProps, prevState) {
		console.log('prevProps: ' + prevProps);
	}

	componentWillUnmount() {
	}

	render() {
		return (<div className='frame-container' id={'frame'} />)
	}
}
